import React from "react";
import "./About.css";

//creo el componente funcional About que se mostrará en la ruta /about
export default function About() {
    return (
        <div><span>C</span><span>S</span><span>S</span><span>&nbsp;</span><span>S</span><span>m</span><span>o</span><span>k</span><span>y</span><span>&nbsp;</span><span>T</span><span>e</span><span>x</span><span>t</span><span>&nbsp;</span><span>E</span><span>f</span><span>f</span><span>e</span><span>c</span><span>t</span></div>

    )
}
